import React, { Component } from "react";
import { Dropdown, DropdownButton, ButtonGroup } from "react-bootstrap";
import SearchBarwithShowVDS from "./SearchBarwithShowVDS";
export default class ShowVideos extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ApiRes: this.props
        };
        console.log(this.state.ApiRes)
    }

    getID=(event)=>{
        let A_id = event.target.id
this.MP3(A_id)


    }

    MP3 = (index,id,a) => {
        let obj = {
            id: a,
            format: ['--format=18']

        }
       let obj1={
          index:index,
          id:id}
          obj1.map((i,e)=>{
              console.log(i,e)
          })
        console.log('obj for download', obj)
        //    fetch(fetch(`http://localhost:3001/Videoid?quality=${this.state.value}`))

    }


    MP4 = (v) => {
        alert('i am clicked')

    }
    HD = (v) => {
        alert('i am clicked')

    }
    render() {
        return (
            <div className="tmShowvideos">
                <SearchBarwithShowVDS />
                <br />
                <div class='container my-3' align='center'>

                    {this.state.ApiRes.obj.map((e, index) => {


                      return (

                            <div>
                                <div class="embed-responsive embed-responsive-16by9">
                                    <iframe id={`${index}`} title="myFrame" width="560" height="315" src={`//www.youtube.com/embed/${e.id}`} allowFullScreen></iframe>
                                </div>
                                <div>
                                    <div className="mb-2" align='right'>
                                        {['up'].map((direction) => (
                                            <DropdownButton
                                                as={ButtonGroup}
                                                key={direction}
                                                id={`${index}`}
                                                drop={direction}
                                                variant="outline-success"
                                                title={` Download`}
                                                onClick={this.getID}
                                            >
                                                <Dropdown.Header><b>Format</b></Dropdown.Header>
                                                <Dropdown.Divider />
                                                <Dropdown.Item onClick={this.MP3(index,e.id)}>MP3</Dropdown.Item>
                                                <Dropdown.Item onClick={this.MP4}>MP4</Dropdown.Item>
                                                <Dropdown.Item onClick={this.HD} >HD</Dropdown.Item>
                                            </DropdownButton>
                                        ))}
                                    </div>
                                </div>

                                <br />
                            </div>
                        )

                    })}

                </div>

            </div >
        );
    }
}
